The &lt;a href="1994%20in%20football%20%28soccer%29"&gt;1994&lt;/a&gt; &lt;a href="Baltic%20Cup%20%28football%29"&gt;Baltic Cup&lt;/a&gt; &lt;a href="Football%20%28soccer%29"&gt;football&lt;/a&gt; competition took place from 29–31 July 1994 at the &lt;a href="%C5%BDalgiris%20Stadium"&gt;Žalgiris Stadium&lt;/a&gt; in &lt;a href="Vilnius"&gt;Vilnius&lt;/a&gt;, &lt;a href="Lithuania"&gt;Lithuania&lt;/a&gt;. It was the fourth annual competition of the three &lt;a href="Baltic%20states"&gt;Baltic states&lt;/a&gt; – &lt;a href="Latvia%20national%20football%20team"&gt;Latvia&lt;/a&gt;, &lt;a href="Lithuania%20national%20football%20team"&gt;Lithuania&lt;/a&gt; and &lt;a href="Estonia%20national%20football%20team"&gt;Estonia&lt;/a&gt; – since they regained their independence from the &lt;a href="Soviet%20Union"&gt;Soviet Union&lt;/a&gt; in 1991.
